import './styles.css';
import Logo from './biomelogo.png';

function App() {
  return (
    <div>
        <header className="flex w-full bg-biome_dark p-2">
          <div className="mx-4">
            <img src={Logo} alt="" className="w-8 h-8"/>
          </div>
          <form> action=""</form>
        </header>
    </div>
  );
}

export default App;
